import React from 'react';
import { Container, Row, Col } from "react-bootstrap";

import TopBanner from './TopBanner';

function Home() {
  return (
    <div id="home" className="home my-2">
      <Container className="mx-auto mb-5">
        <Row><TopBanner /></Row>
      </Container>
    </div>
  )
}

export default Home;
